// Header.js

import React from 'react';
import { Link, Outlet, useNavigate } from 'react-router-dom';
import two from '../assets/Images/2nd ALL TIME CHILLERS.jpg'
import MenuOne from './MenuOne';
import MenuTwo from './MenuTwo';
import MenuThree from './MenuThree';
import MenuFour from './MenuFour';
import MenuFive from './MenuFive';

function Header() {
  const navigate = useNavigate();

  const handleTabClick = (event, path) => {
    event.preventDefault();
    navigate(path);
  };

  return (
    <div className="container-fluid rounded-4">
      <div className="row mt-3">
      <div className="container-fluid mb-5 bg-white bg-opacity-25 p-2">
        <div className="row mt-5">
          <div className="col-sm-12">
            <h1 className="text-center justify-content-center align-items-center">
              Best in Class <br /> Hot and Cold Beverages
            </h1>
          </div>
          </div>

          <div className="col-sm-12 bg-dark bg-opacity-25 ">
            <div className="card text-center mt-3 mb-3">
              <div className="card-header shadow-lg p-3 mb-5 bg-body rounded">
                <Link className="m-5 fs-4 mytext text-decoration-none" to="/home/menu-one">All Chillers</Link>
                <Link className="m-5 fs-4 mytext text-decoration-none"  to="/home/menu-two">All Delights</Link>
                <Link className="m-5 fs-4 mytext text-decoration-none"  to="/home/menu-three">Classics</Link>
                <Link className="m-5 fs-4 mytext text-decoration-none"  to="/home/menu-four">Sweet Tooth</Link>
                <Link className="m-5 fs-4 mytext text-decoration-none"  to="/home/menu-five">Chillers</Link>
              </div>
              <div className="card-body">
                <Outlet />
              </div>
            </div>
          
        </div>
      </div>
      </div>
    </div>
  );
}

export default Header;
